B.a58=new A.bX(B.a96,["import 'package:flutter/material.dart';\nimport 'package:provider/provider.dart';\nimport 'features/todo/todo_provider.dart';\nimport 'features/todo/todo_screen.dart';\n\nvoid main() {\n  runApp(const MyApp());\n}\n\nclass MyApp extends StatelessWidget {\n  const MyApp({super.key});\n\n  @override\n  Widget build(BuildContext context) {\n    return ChangeNotifierProvider(\n      create: (_) => TodoProvider(),\n      child: MaterialApp(\n        title: 'Todo App',\n        debugShowCheckedModeBanner: false,\n        theme: ThemeData(\n          colorScheme: ColorScheme.fromSeed(seedColor: Colors.teal),\n          useMaterial3: true,\n        ),\n        home: const TodoScreen(),\n      ),\n    );\n  }\n}\n","class Todo {\n  final String id;\n  final String title;\n  final String? description;\n  final bool isCompleted;\n  final DateTime createdAt;\n  final DateTime? dueDate;\n\n  Todo({\n    required this.id,\n    required this.title,\n    this.description,\n    this.isCompleted = false,\n    required this.createdAt,\n    this.dueDate,\n  });\n\n  Todo copyWith({\n    String? id,\n    String? title,\n    String? description,\n    bool? isCompleted,\n    DateTime? createdAt,\n    DateTime? dueDate,\n  }) {\n    return Todo(\n      id: id ?? this.id,\n      title: title ?? this.title,\n      description: description ?? this.description,\n      isCompleted: isCompleted ?? this.isCompleted,\n      createdAt: createdAt ?? this.createdAt,\n      dueDate: dueDate ?? this.dueDate,\n    );\n  }\n}\n","import 'package:flutter/material.dart';\nimport 'package:provider/provider.dart';\nimport 'todo_provider.dart';\nimport '../../models/todo.dart';\n\nclass TodoScreen extends StatelessWidget {\n  const TodoScreen({super.key});\n\n  @override\n  Widget build(BuildContext context) {\n    return Scaffold(\n      appBar: AppBar(\n        title: const Text('My Tasks'),\n        backgroundColor: Theme.of(context).colorScheme.inversePrimary,\n      ),\n      body: Consumer<TodoProvider>(\n        builder: (context, provider, child) {\n          if (provider.todos.isEmpty) {\n            return const Center(\n              child: Text('No tasks yet. Add one!'),\n            );\n          }\n          return ListView.builder(\n            padding: const EdgeInsets.all(16),\n            itemCount: provider.todos.length,\n            itemBuilder: (context, index) {\n              final todo = provider.todos[index];\n              return _TodoCard(todo: todo);\n            },\n          );\n        },\n      ),\n      floatingActionButton: FloatingActionButton(\n        onPressed: () => _showAddDialog(context),\n        child: const Icon(Icons.add),\n      ),\n    );\n  }\n\n  void _showAddDialog(BuildContext context) {\n    final controller = TextEditingController();\n    showDialog(\n      context: context,\n      builder: (context) => AlertDialog(\n        title: const Text('Add Task'),\n        content: TextField(\n          controller: controller,\n          decoration: const InputDecoration(\n            hintText: 'Task title',\n          ),\n          autofocus: true,\n        ),\n        actions: [\n          TextButton(\n            onPressed: () => Navigator.pop(context),\n            child: const Text('Cancel'),\n          ),\n          FilledButton(\n            onPressed: () {\n              if (controller.text.isNotEmpty) {\n                context.read<TodoProvider>().addTodo(controller.text);\n                Navigator.pop(context);\n              }\n            },\n            child: const Text('Add'),\n          ),\n        ],\n      ),\n    );\n  }\n}\n\nclass _TodoCard extends StatelessWidget {\n  final Todo todo;\n\n  const _TodoCard({required this.todo});\n\n  @override\n  Widget build(BuildContext context) {\n    return Card(\n      margin: const EdgeInsets.only(bottom: 8),\n      child: ListTile(\n        leading: Checkbox(\n          value: todo.isCompleted,\n          onChanged: (value) {\n            context.read<TodoProvider>().toggleTodo(todo.id);\n          },\n        ),\n        title: Text(\n          todo.title,\n          style: TextStyle(\n            decoration: todo.isCompleted ? TextDecoration.lineThrough : null,\n          ),\n        ),\n        trailing: IconButton(\n          icon: const Icon(Icons.delete),\n          onPressed: () {\n            context.read<TodoProvider>().deleteTodo(todo.id);\n          },\n        ),\n      ),\n    );\n  }\n}\n","import 'package:flutter/foundation.dart';\nimport '../../models/todo.dart';\n\nclass TodoProvider extends ChangeNotifier {\n  final List<Todo> _todos = [];\n\n  List<Todo> get todos => List.unmodifiable(_todos);\n\n  void addTodo(String title, {String? description, DateTime? dueDate}) {\n    final todo = Todo(\n      id: DateTime.now().millisecondsSinceEpoch.toString(),\n      title: title,\n      description: description,\n      createdAt: DateTime.now(),\n      dueDate: dueDate,\n    );\n    _todos.add(todo);\n    notifyListeners();\n  }\n\n  void toggleTodo(String id) {\n    final index = _todos.indexWhere((t) => t.id == id);\n    if (index != -1) {\n      _todos[index] = _todos[index].copyWith(\n        isCompleted: !_todos[index].isCompleted,\n      );\n      notifyListeners();\n    }\n  }\n\n  void deleteTodo(String id) {\n    _todos.removeWhere((t) => t.id == id);\n    notifyListeners();\n  }\n\n  void updateTodo(String id, {String? title, String? description}) {\n    final index = _todos.indexWhere((t) => t.id == id);\n    if (index != -1) {\n      _todos[index] = _todos[index].copyWith(\n        title: title,\n        description: description,\n      );\n      notifyListeners();\n    }\n  }\n}\n"],t.li)
