B.a4O=new A.bX(B.a8P,["import 'package:flutter/material.dart';\nimport 'package:provider/provider.dart';\nimport 'features/cart/cart_provider.dart';\nimport 'features/home/home_screen.dart';\n\nvoid main() {\n  runApp(const MyApp());\n}\n\nclass MyApp extends StatelessWidget {\n  const MyApp({super.key});\n\n  @override\n  Widget build(BuildContext context) {\n    return ChangeNotifierProvider(\n      create: (_) => CartProvider(),\n      child: MaterialApp(\n        title: 'Shop App',\n        debugShowCheckedModeBanner: false,\n        theme: ThemeData(\n          colorScheme: ColorScheme.fromSeed(seedColor: Colors.indigo),\n          useMaterial3: true,\n        ),\n        home: const HomeScreen(),\n      ),\n    );\n  }\n}\n","class Product {\n  final String id;\n  final String name;\n  final String description;\n  final double price;\n  final String imageUrl;\n  final String category;\n\n  Product({\n    required this.id,\n    required this.name,\n    required this.description,\n    required this.price,\n    required this.imageUrl,\n    required this.category,\n  });\n}\n\n// Sample products\nfinal sampleProducts = [\n  Product(\n    id: '1',\n    name: 'Wireless Headphones',\n    description: 'High-quality wireless headphones with noise cancellation',\n    price: 199.99,\n    imageUrl: 'https://picsum.photos/200?random=1',\n    category: 'Electronics',\n  ),\n  Product(\n    id: '2',\n    name: 'Smart Watch',\n    description: 'Fitness tracking smartwatch with heart rate monitor',\n    price: 299.99,\n    imageUrl: 'https://picsum.photos/200?random=2',\n    category: 'Electronics',\n  ),\n  Product(\n    id: '3',\n    name: 'Running Shoes',\n    description: 'Comfortable running shoes for all terrains',\n    price: 89.99,\n    imageUrl: 'https://picsum.photos/200?random=3',\n    category: 'Sports',\n  ),\n];\n","import 'package:flutter/material.dart';\nimport 'package:provider/provider.dart';\nimport '../../models/product.dart';\nimport '../cart/cart_provider.dart';\nimport '../cart/cart_screen.dart';\n\nclass HomeScreen extends StatelessWidget {\n  const HomeScreen({super.key});\n\n  @override\n  Widget build(BuildContext context) {\n    return Scaffold(\n      appBar: AppBar(\n        title: const Text('Shop'),\n        backgroundColor: Theme.of(context).colorScheme.inversePrimary,\n        actions: [\n          Consumer<CartProvider>(\n            builder: (context, cart, child) {\n              return Badge(\n                label: Text('${cart.itemCount}'),\n                isLabelVisible: cart.itemCount > 0,\n                child: IconButton(\n                  icon: const Icon(Icons.shopping_cart),\n                  onPressed: () {\n                    Navigator.push(\n                      context,\n                      MaterialPageRoute(builder: (_) => const CartScreen()),\n                    );\n                  },\n                ),\n              );\n            },\n          ),\n        ],\n      ),\n      body: GridView.builder(\n        padding: const EdgeInsets.all(16),\n        gridDelegate: const SliverGridDelegateWithFixedCrossAxisCount(\n          crossAxisCount: 2,\n          childAspectRatio: 0.75,\n          crossAxisSpacing: 16,\n          mainAxisSpacing: 16,\n        ),\n        itemCount: sampleProducts.length,\n        itemBuilder: (context, index) {\n          return _ProductCard(product: sampleProducts[index]);\n        },\n      ),\n    );\n  }\n}\n\nclass _ProductCard extends StatelessWidget {\n  final Product product;\n\n  const _ProductCard({required this.product});\n\n  @override\n  Widget build(BuildContext context) {\n    return Card(\n      clipBehavior: Clip.antiAlias,\n      child: Column(\n        crossAxisAlignment: CrossAxisAlignment.start,\n        children: [\n          Expanded(\n            child: Container(\n              color: Colors.grey[200],\n              child: Center(\n                child: Icon(\n                  Icons.image,\n                  size: 48,\n                  color: Colors.grey[400],\n                ),\n              ),\n            ),\n          ),\n          Padding(\n            padding: const EdgeInsets.all(8),\n            child: Column(\n              crossAxisAlignment: CrossAxisAlignment.start,\n              children: [\n                Text(\n                  product.name,\n                  style: Theme.of(context).textTheme.titleSmall,\n                  maxLines: 1,\n                  overflow: TextOverflow.ellipsis,\n                ),\n                const SizedBox(height: 4),\n                Text(\n                  '\\$${product.price.toStringAsFixed(2)}',\n                  style: Theme.of(context).textTheme.titleMedium?.copyWith(\n                    color: Theme.of(context).colorScheme.primary,\n                  ),\n                ),\n                const SizedBox(height: 8),\n                SizedBox(\n                  width: double.infinity,\n                  child: FilledButton.tonal(\n                    onPressed: () {\n                      context.read<CartProvider>().addToCart(product);\n                      ScaffoldMessenger.of(context).showSnackBar(\n                        SnackBar(content: Text('Added ${product.name} to cart')),\n                      );\n                    },\n                    child: const Text('Add to Cart'),\n                  ),\n                ),\n              ],\n            ),\n          ),\n        ],\n      ),\n    );\n  }\n}\n","import 'package:flutter/material.dart';\nimport 'package:provider/provider.dart';\nimport 'cart_provider.dart';\n\nclass CartScreen extends StatelessWidget {\n  const CartScreen({super.key});\n\n  @override\n  Widget build(BuildContext context) {\n    return Scaffold(\n      appBar: AppBar(\n        title: const Text('Cart'),\n        backgroundColor: Theme.of(context).colorScheme.inversePrimary,\n      ),\n      body: Consumer<CartProvider>(\n        builder: (context, cart, child) {\n          if (cart.items.isEmpty) {\n            return const Center(\n              child: Text('Your cart is empty'),\n            );\n          }\n          return Column(\n            children: [\n              Expanded(\n                child: ListView.builder(\n                  itemCount: cart.items.length,\n                  itemBuilder: (context, index) {\n                    final item = cart.items[index];\n                    return ListTile(\n                      title: Text(item.product.name),\n                      subtitle: Text('\\$${item.product.price.toStringAsFixed(2)} x ${item.quantity}'),\n                      trailing: Row(\n                        mainAxisSize: MainAxisSize.min,\n                        children: [\n                          IconButton(\n                            icon: const Icon(Icons.remove),\n                            onPressed: () => cart.decrementQuantity(item.product.id),\n                          ),\n                          Text('${item.quantity}'),\n                          IconButton(\n                            icon: const Icon(Icons.add),\n                            onPressed: () => cart.addToCart(item.product),\n                          ),\n                        ],\n                      ),\n                    );\n                  },\n                ),\n              ),\n              Container(\n                padding: const EdgeInsets.all(16),\n                decoration: BoxDecoration(\n                  color: Theme.of(context).colorScheme.surface,\n                  boxShadow: [\n                    BoxShadow(\n                      color: Colors.black.withOpacity(0.1),\n                      blurRadius: 8,\n                      offset: const Offset(0, -2),\n                    ),\n                  ],\n                ),\n                child: Row(\n                  mainAxisAlignment: MainAxisAlignment.spaceBetween,\n                  children: [\n                    Text(\n                      'Total: \\$${cart.total.toStringAsFixed(2)}',\n                      style: Theme.of(context).textTheme.titleLarge,\n                    ),\n                    FilledButton(\n                      onPressed: () {\n                        // Checkout logic\n                      },\n                      child: const Text('Checkout'),\n                    ),\n                  ],\n                ),\n              ),\n            ],\n          );\n        },\n      ),\n    );\n  }\n}\n","import 'package:flutter/foundation.dart';\nimport '../../models/product.dart';\n\nclass CartItem {\n  final Product product;\n  int quantity;\n\n  CartItem({required this.product, this.quantity = 1});\n}\n\nclass CartProvider extends ChangeNotifier {\n  final List<CartItem> _items = [];\n\n  List<CartItem> get items => List.unmodifiable(_items);\n\n  int get itemCount => _items.fold(0, (sum, item) => sum + item.quantity);\n\n  double get total => _items.fold(\n    0,\n    (sum, item) => sum + (item.product.price * item.quantity),\n  );\n\n  void addToCart(Product product) {\n    final existingIndex = _items.indexWhere((item) => item.product.id == product.id);\n    if (existingIndex != -1) {\n      _items[existingIndex].quantity++;\n    } else {\n      _items.add(CartItem(product: product));\n    }\n    notifyListeners();\n  }\n\n  void removeFromCart(String productId) {\n    _items.removeWhere((item) => item.product.id == productId);\n    notifyListeners();\n  }\n\n  void decrementQuantity(String productId) {\n    final index = _items.indexWhere((item) => item.product.id == productId);\n    if (index != -1) {\n      if (_items[index].quantity > 1) {\n        _items[index].quantity--;\n      } else {\n        _items.removeAt(index);\n      }\n      notifyListeners();\n    }\n  }\n\n  void clearCart() {\n    _items.clear();\n    notifyListeners();\n  }\n}\n"],t.li)
